export default function MainContainer() {
  const movie=useSelector(store=>store.movie?.nowPlayingMovies);
  if(!movie) return ; // this method is called early return
  console.log(movie);
  return (
    <div>
        <VideoTitle/>
        <VideoBackground/>
    </div>
  )
}
